    </style><style type="text/css" data-tag-name="trix-editor">trix-editor {
    display: block;
}

trix-editor:empty::before {
    content: attr(placeholder);
    color: graytext;
    cursor: text;
    pointer-events: none;
    white-space: pre-line;
}

trix-editor a[contenteditable=false] {
    cursor: text;
}

trix-editor img {
    max-width: 100%;
    height: auto;
}

trix-editor [data-trix-attachment] figcaption textarea {
    resize: none;
}

trix-editor [data-trix-attachment] figcaption textarea.trix-autoresize-clone {
    position: absolute;
    left: -9999px;
    max-height: 0px;
}

trix-editor [data-trix-attachment] figcaption[data-trix-placeholder]:empty::before {
    content: attr(data-trix-placeholder);
    color: graytext;
}

trix-editor [data-trix-cursor-target] {
    display: inline-block !important;
    width: 1px !important;
    padding: 0 !important;
    margin: 0 !important;
    border: none !important;
}

trix-editor [data-trix-cursor-target=left] {
    vertical-align: top !important;
    margin-left: -1px !important;
}

trix-editor [data-trix-cursor-target=right] {
    vertical-align: bottom !important;
    margin-right: -1px !important;
}</style><style type="text/css" data-tag-name="trix-toolbar">trix-toolbar {
  display: block;
}

trix-toolbar {
  white-space: nowrap;
}

trix-toolbar [data-trix-dialog] {
  display: none;
}

trix-toolbar [data-trix-dialog][data-trix-active] {
  display: block;
}

trix-toolbar [data-trix-dialog] [data-trix-validate]:invalid {
  background-color: #ffdddd;
}</style><style type="text/css">.turbo-progress-bar {

<script>
  const rootElement = document.documentElement;
  const rootStyles = getComputedStyle(rootElement)
  const rootColor = rootStyles.getPropertyValue('--cfcc-color-brand-primary');
  const rootDefaultColor = rootStyles.getPropertyValue('--cfcc-color-brand-primary-default');

  function generateColorScale(baseColor, steps = 11) {
    const color = chroma(baseColor);

    const scale = chroma.scale([
      color.set('hsl.l', 0.95), // Lightest
      color,                    // Base color
      color.set('hsl.l', 0.15)  // Darkest
    ])
      .mode('lab')
      .colors(steps);

    return scale.map(c => chroma(c).hex());
  }

  function generateTailwindColors(baseColor) {
    const scale = generateColorScale(baseColor, 11);

    [50, 100, 200, 300, 400, 500, 600, 700, 800, 900, 950].forEach((step, index) => {
      rootElement.style.setProperty(`--cfcc-color-brand-${step}`, scale[index]);
    });
  }

  generateTailwindColors(rootColor);

  // set primary contrast value
  const mainBrandColor = rootColor ? rootColor : rootDefaultColor;

  // check contrast for each potential text color in use.
  const textStrongColor = chroma('#1f1f1f');
  const textMediumColor = chroma('#404040');
  const textWeakColor = chroma('#8c8c8c');

  if (chroma.contrast(mainBrandColor, textStrongColor) <= 7) {
    rootElement.style.setProperty('--cfcc-color-brand-500-strong-contrast', 'white');
  } else {
    rootElement.style.setProperty(
      '--cfcc-color-brand-500-strong-contrast',
      textStrongColor.hex()
    );
  }

  if (chroma.contrast(mainBrandColor, textMediumColor) <= 7) {
    rootElement.style.setProperty('--cfcc-color-brand-500-medium-contrast', 'white');
  } else {
    rootElement.style.setProperty(
      '--cfcc-color-brand-500-medium-contrast',
      textMediumColor.hex()
    );
  }

  if (chroma.contrast(mainBrandColor, textWeakColor) <= 7) {
    rootElement.style.setProperty('--cfcc-color-brand-500-weak-contrast', 'white');
  } else {
    rootElement.style.setProperty(
      '--cfcc-color-brand-500-weak-contrast',
      textWeakColor.hex()
    );
  }
</script>
